
// 3441. Minimum Cost Good Caption
// https://leetcode.com/problems/minimum-cost-good-caption/







class Solution {
private:
    // debug
    int get_cost(string& a, string& b) {
        // returns cost to transform string a into b
        // it is guaranteed that a.size() == b.size()
        int n = a.size();
        int cost = 0;
        for(int i = 0; i < n; ++i)
            cost += abs(a[i] - b[i]);
        return cost;
    }

    struct T{
        int cost;
        int count;
        char chr;
        T() : cost(-1), count(0), chr('#') {}
        T(int cost, int count, char chr) : cost(cost), count(count), chr(chr) {}
    };

    bool cmp(char a, int counta, char b, int countb, int pos, int n, vector<T*>& mem) {
        // returns true if 'string a' is lexicograhically smaller than 'string b'

        int lcounta = 0;
        int lcountb = 0;
        for(; pos < n; ++pos) {
            if( lcounta == counta ) {
                lcounta = 0;
                counta = mem[pos]->count;
                a = mem[pos]->chr;
            }
            if( lcountb == countb ) {
                lcountb = 0;
                countb = mem[pos]->count;
                b = mem[pos]->chr;
            }
            if( a < b ) {
                return true;
            } else if( a > b ) {
                return false;
            }

            // we are chasing each other
            // TODO this may also hold if abs(lcounta - lcountb) <= 1
            // if( lcounta == lcountb )
            //     return true;
            ++lcounta;
            ++lcountb;
        }
        return true;
    }

    T* rec(string& s, int n, int pos, vector<T*>& mem) {

        if( mem[pos] != nullptr )
            return mem[pos];

        int mn_cost = INT_MAX;
        int count;
        char chr;

        // if n-pos < 6 we no other option other than
        // to make the remaining chars including at pos the same
        if( n - pos < 6 ) {
            for(char c = 'a'; c <= 'z'; ++c) {
                int cost = 0;
                for(int i = pos; i < n; ++i)
                    cost += abs(s[i] - c);
                if( cost < mn_cost ) {
                    mn_cost = cost;
                    chr = c;
                }
            }
            count = n-pos;
            T * t = new T(mn_cost, count, chr);
            return mem[pos] = t;
        }

        // turn us and the next 2 chars into the same char
        for(char c = 'a'; c <= 'z'; ++c) {
            int cost = abs(s[pos] - c) + abs(s[pos+1] - c) + abs(s[pos+2] - c);
            auto p = rec(s, n, pos+3, mem);
            if( cost + p->cost < mn_cost ) {
                mn_cost = cost + p->cost;
                count = 3;
                chr = c;
            }
        }

        // at this point we have the best answer (smallest cost and smallest char)
        // if we turn us and the next 2 chars into the same char, so the next 6 char
        // we also need to investigate: us + next 3 chars and us + next 4 chars
        // example: lets say we got bbbccc, but if we try bbbb we get SAME cost,
        //          but bbbb is lexicographically smaller, the bbbb... wins
        // example: "gbgozyxvx" ans -> "ggggxxxxx"    correct ans (cost 18)
        //                             "gggyyyxxx" incorrecct ans (cost 18)
        // lower cost always wins
        // watch out for the remaining length

        // us plus next 4
        if( n - (pos + 5) >= 3 ) {
            for(char c = 'a'; c <= 'z'; ++c) {
                int cost = abs(s[pos] - c) + abs(s[pos+1] - c) + abs(s[pos+2] - c) + abs(s[pos+3] - c) + abs(s[pos+4] - c);
                auto p = rec(s, n, pos+5, mem);
                if( cost + p->cost < mn_cost ) {
                    mn_cost = cost + p->cost;
                    count = 5;
                    chr = c;

                } else if( cost + p->cost == mn_cost ) {

                    if( cmp(c, 5, chr, count, pos, n, mem) ) {
                        count = 5;
                        chr = c;
                    }
                }
            }
        }

        // us plus next 3
        if( n - (pos + 4) >= 3 ) {
            for(char c = 'a'; c <= 'z'; ++c) {
                int cost = abs(s[pos] - c) + abs(s[pos+1] - c) + abs(s[pos+2] - c) + abs(s[pos+3] - c);
                auto p = rec(s, n, pos+4, mem);
                if( cost + p->cost < mn_cost ) {
                    mn_cost = cost + p->cost;
                    count = 4;
                    chr = c;

                } else if( cost + p->cost == mn_cost ) {

                    if( cmp(c, 4, chr, count, pos, n, mem) ) {
                        count = 4;
                        chr = c;
                    }
                }
            }
        }


        T * t = new T(mn_cost, count, chr);
        return mem[pos] = t;
    }

public:
    string minCostGoodCaption(string caption) {
        int n = caption.size();
        if( n < 3 )
            return "";

        // debug
        /*
        // string    s = "ukfggupaxjfoacjnhdzbwnqcxtirhphbbmjjibjfmptmteaahbddotilnsdujmxnyjwgkgnwxiksmkvtlyzbsjnhbsdmeczelwmv";
        // string res1 = "kkkgggpppjjjccchhhwwwnnntttpppbbbjjjiiimmmtttaaaddddooonnnjjjnnnwwwgggwwwkkkktttyyyjjjjhhhddddlllvvv";
        // string res2 = "gggggppppjjjccchhhwwwnnntttpppbbbjjjjfffpppppaaaddddnnnnnsssmmmmwwwgggwwwkkkkkvvvvvjjjjhhhddddlllvvv";
        // string s = "gbgozyxvx";
        // string res1 = "ggggxxxxx";
        // string res2 = "gggyyyxxx";
        string s = "qtavos";
        string res1 = "qqqqqs";
        string res2 = "qqqsss";
        int a = get_cost(s, res1);
        int b = get_cost(s, res2);
        cout << a << " " << b << endl;
        return "";
        */



        vector<T*> mem(n, nullptr);
        rec(caption, n, 0, mem);

        // construct string to return from mem
        string ans = "";
        for(int i = 0; i < n; ) {
            int count = mem[i]->count;
            char chr = mem[i]->chr;
            ans.append(count, chr);
            i += count;
        }

        return ans;
    }
};




